import os
from fastapi.testclient import TestClient
from unittest.mock import patch
from src.api.main import app

client = TestClient(app)

headers = {"Authorization": f"Bearer {os.getenv('SECRET_KEY')}"}

def test_unauthenticated_request():
    response = client.get("/api/v1/vins")
    assert response.status_code == 401
    assert response.json() == {"detail": "Not authenticated"}  # Expected result
    
def test_invalid_credentials_request():
    response = client.get("/api/v1/vins", headers= {"Authorization": "Bearer wrong_key"})
    assert response.status_code == 401
    assert response.json() == {"detail": "Invalid credentials"} 

def test_get_vins():
    response = client.get("/api/v1/vins", headers=headers)
    assert response.status_code == 200
    assert response.json() == ["VjamRugCrs8356684", "kGnkdVNDSU7115538", "cLrVrQDRWs0069145", "RzIEMxvoHd6229617"]

def test_get_companies():
    response = client.get("/api/v1/companies", headers=headers)
    assert response.status_code == 200
    assert response.json() == ["CarRent", "InsuranceCar"]
    
def test_get_column_data():
    response = client.get("/api/v1/data/mileage/VjamRugCrs8356684", headers=headers)
    assert response.status_code == 200
    assert response.json() == 92580
    
